import { Component } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-participant-register',
  templateUrl: 'participant-register.component.html',
  styleUrls: ['pa']
})
export class RegisterComponent {
  participant: any = {
    name: '',
    email: '',
    phone: '',
    user: {
      username: '',
      password: ''
    }
  };

  loading = false;
  successMessage = '';
  errorMessage = '';

  private apiUrl = 'http://localhost:5070/api/Participants/Register'; // ✅ Your API endpoint

  constructor(private http: HttpClient) {}

  onSubmit(form: any) {
    if (form.invalid) {
      this.errorMessage = 'Please fill in all required fields correctly.';
      return;
    }

    this.loading = true;
    this.successMessage = '';
    this.errorMessage = '';

    this.http.post<any>(this.apiUrl, this.participant).subscribe({
      next: (res) => {
        this.successMessage = res.message || 'Participant registered successfully!';
        this.errorMessage = '';
        this.loading = false;

        // Reset form after successful registration
        form.resetForm();
        this.participant = {
          name: '',
          email: '',
          phone: '',
          user: {
            username: '',
            password: ''
          }
        };
      },
      error: (err) => {
        this.errorMessage = err.error || 'An error occurred during registration.';
        this.successMessage = '';
        this.loading = false;
      }
    });
  }
}
<div class="register-container">
  <form class="register-form" #participantForm="ngForm" (ngSubmit)="onSubmit(participantForm)">
    <h2>Register Participant</h2>

    <!-- Name -->
    <div class="form-group">
      <label>Name *</label>
      <input type="text" [(ngModel)]="participant.name" name="name" required />
      <div *ngIf="participantForm.submitted && !participant.name" class="error">
        Name is required
      </div>
    </div>

    <!-- Email -->
    <div class="form-group">
      <label>Email *</label>
      <input type="email" [(ngModel)]="participant.email" name="email" required email />
      <div *ngIf="participantForm.submitted && !participant.email" class="error">
        Valid email is required
      </div>
    </div>

    <!-- Phone -->
    <div class="form-group">
      <label>Phone *</label>
      <input
        type="text"
        [(ngModel)]="participant.phone"
        name="phone"
        required
        pattern="^[0-9]{10}$"
      />
      <div *ngIf="participantForm.submitted && !participant.phone" class="error">
        Phone number is required
      </div>
    </div>

    <!-- Username -->
    <div class="form-group">
      <label>Username *</label>
      <input type="text" [(ngModel)]="participant.user.username" name="username" required minlength="4" />
      <div *ngIf="participantForm.submitted && !participant.user?.username" class="error">
        Username is required
      </div>
    </div>

    <!-- Password -->
    <div class="form-group">
      <label>Password *</label>
      <input
        type="password"
        [(ngModel)]="participant.user.password"
        name="password"
        required
        minlength="6"
      />
      <div *ngIf="participantForm.submitted && !participant.user?.password" class="error">
        Password is required
      </div>
    </div>

    <!-- Submit Button -->
    <button type="submit" class="register-btn" [disabled]="participantForm.invalid || loading">
      {{ loading ? 'Registering...' : 'Register Participant' }}
    </button>
  </form>

  <!-- Messages -->
  <div *ngIf="successMessage" class="success">{{ successMessage }}</div>
  <div *ngIf="errorMessage" class="error">{{ errorMessage }}</div>
</div>
